const startDemo = () => {
	const productPage = { 
		product_id: "000000000000000000000000", 
		img_url: null,
		contents: { 
			artificial_sweeteners: [ 
				{ 
					name: "sugar" 
				} 
			] 
		} 
	}
	localStorage.setItem('000000000000000000000000', productPage);
	return productPage;
}

export default startDemo;
